import React, { Component } from "react";
import Zoom from "react-reveal/Zoom";

export class App extends Component {
  render() {
    return (
      <h1>
        <Zoom left cascade>
          <div style={{ display: "inline-block" }}>React</div>
        </Zoom>
        <Zoom right cascade>
          <div style={{ display: "inline-block" }}> Reveal</div>
        </Zoom>
      </h1>
    );
  }
}

export default App;
